  const [listItem, setListItem] = useState([]);

  useEffect(() => {
    getItems();
  }, []);

  const getItems = () => {
    const server = new Promise((resolve, rejet) => {
      setTimeout(() => {
        resolve(procesador);
      }, 1000);
    });
    server.then((rest) => {
      setListItem(rest);
    });
  };
  console.log(listItem);
